      name: "pear",
      price: "0.60"
    },
    {
      id: "0004-avocado",
      name: "avocado",
      price: "1.10"
    }
  ]

  const [products, setProducts] = useState(items)


  return (
    <div className="store">
      <h1> Store</h1>
      <ul>
        {items.map(item => (
          <li className="store--item-list">
            {item}
          </li>
        )

        )}

      </ul>
    </div>
  )
};
